import React,{useState,useEffect} from 'react'
import axios from 'axios'

import {Grid,Image,Card} from 'semantic-ui-react'
import { Link } from 'react-router-dom';


const SwiperSlider = () => {

  const [multipleFiles, setMultipleFiles] = useState([]);
  const getMultipleFiles = async () => {
    try{
        const {data} = await axios.get('http://localhost:5000/api/getMultipleFiles');
        return data;
    }catch(error){
        throw error;
    }
}
  const getMultipleFilesList = async () => {
    try {
        const fileslist = await getMultipleFiles();
        setMultipleFiles(fileslist);
    } catch (error) {
      console.log(error);
    }
  }
    useEffect(() => {
      getMultipleFilesList()
      // eslint-disable-next-line react-hooks/exhaustive-deps
    }, []);
    return (
      <div>
        <Grid columns={2}>
            {multipleFiles.map((element, index) =>
                <div key={element._id}>
                 <Card>
                  <Card.Content>
                    <Grid>
                        <Grid.Column>

                      {element.map((fields, index) =>
                          <div>
                            {
                            fields.files.map((url,id)=>{
                                <div className="col-6" key={id}>

                                  <Link to={`/houseDetails/${element._id}`}>
                                        <Image src={url} wrapped alt="img"/>
                                  </Link>

                                </div>
                              }),
                              <div>
                                housename={fields.housename},
                                description={fields.description}
                              </div>

                            }
                          </div>

                       )}
                       </Grid.Column>
                    </Grid>
                  </Card.Content>
                      <Card.Content extra>
                        <Card.Description>
                          {element.title}
                          , {element._id}
                        </Card.Description>
                      </Card.Content>
                </Card>
                </div>
              )}

            </Grid>
      </div>
    )
}

export default SwiperSlider
